import { StyleSheet, View, } from 'react-native';


export default function Hamburger() {
    return(
        <View style={styles.hamburger}>
            <span></span>
            <span></span>
            <span style={styles.hamburgerLast}></span>
        </View>

    );
}

const styles = StyleSheet.create({
    hamburger: {
        display: 'block',
        height: 3,
        width: 8,
        background: 'black'
    },

    hamburgerLast: {
        width:5
    }
  
  });
